import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';  // Import Login component from components folder
import Register from './components/Register';  // Import Register component from components folder
import UserManagement from './components/UserManagement';  // Import UserManagement component from components folder
import './App.css';  // Your custom styles for App (ensure App.css exists)

function App() {
  return (
    <Router>
      <div className="App">
        {/* Setup Routes */}
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/user-management" element={<UserManagement />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
